import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './Table/navbar';
import Login from './Table/helloworld';
import Wilaya from './Table/wilaya';
import { SessionProvider } from './session'; // Import du SessionProvider
import './App.css';
import Home from './Table/home';
import RequireAth from './requireauth';
import RegisterForm from './Table/register';
function App() {
  return (
    <Router>
      <SessionProvider> {/* Envelopper l'application avec le SessionProvider */}
        <Navbar />
        <div>
          <div className="mt-20"></div>
          <Routes>
            <Route path="/wilaya" element={
            <RequireAth>
              <Wilaya />
            </RequireAth>
            } />
            <Route path="/login" element={<Login />} />
            <Route path="/" element={<Home/>} />
            <Route path="/register" element={<RegisterForm/>} />
          </Routes>
        </div>
      </SessionProvider>
    </Router>


  );
}

export default App;
